pragma solidity 0.8.0;

contract Wallet {
  address[] public approvers;
  uint public quorum;
  struct Transfer {
    uint id;
    uint amount;
    address payable to;
    uint approvals;
    bool sent;
  }
  Transfer[] public transfers;

  /*
  * List of addresses who have approved what 
  */
  mapping(address => mapping(uint => bool)) public approvals;

  constructor (address[] memory _approvers, uint _quorum) {
    approvers = _approvers;
    quorum = _quorum;
  }

  function getApprovers() external view returns(address[] memory) {
    return approvers;
  }

  function getTransfers() external view returns(Transfer[] memory) {
    return transfers;
  }

  function fetchTransferApproved(address _address, uint transferId) external view returns(bool) {
    return approvals[_address][transferId];
  }

  function createTransfer(uint amount, address payable to) external onlyApprover() {
    transfers.push(
      Transfer(
        transfers.length,
        amount,
        to,
        0,
        false
      )
    );
  }

  function approveTransfer(uint id) external onlyApprover() {
    require(transfers[id].sent == false, 'Transfer has already been sent');
    require(approvals[msg.sender][id] == false, 'cannot approve transfer twice');

    approvals[msg.sender][id] = true;
    transfers[id].approvals++;

    if (transfers[id].approvals >= quorum) {
      transfers[id].sent = true;
      address payable to = transfers[id].to;
      uint amount = transfers[id].amount;
      to.transfer(amount);
    }
  }

  receive() external payable {}

  modifier onlyApprover() {
    bool allowed = false;
    for (uint i = 0; i < approvers.length; i++) {
      if (approvers[i] == msg.sender) {
        allowed = true;
      }
    }
    require(allowed == true, 'Only approved addresses can approve a transfer');
    _;
  }
}
